% -*- mode: prolog -*-

orbits(A, X, Y) :- gen_assoc(X, A, Y).
orbits(A, X, Y) :- gen_assoc(X, A, Z), orbits(A, Z, Y).

adv06(X) :-
    map(M), transpose_pairs(M, M1), list_to_assoc(M1, A),
    findall(P1-P2, orbits(A, P1, P2), L), length(L, X).

orbit_distance(A, X, Y, 0) :- gen_assoc(X, A, Y).
orbit_distance(A, X, Y, N1) :-
    gen_assoc(X, A, Z),
    orbit_distance(A, Z, Y, N), N1 is N + 1.

adv06b(X) :-
    map(M), transpose_pairs(M, M1), list_to_assoc(M1, A),
    orbit_distance(A, xYOU, C, N1), orbit_distance(A, xSAN, C, N2),
    X is N1 + N2, !.

